#Q.2- Write a program to print twin prime less than 1000.

def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, n):
        if n % i == 0:
            return False
    return True

def twin_prime(n):
    for i in range(2, n):
        if is_prime(i) and is_prime(i + 2):
            print(i, i + 2)

twin_prime(1000)


#Q.3- Write a program to find perfect number in a given range.

def is_perfect(n):
    sum = 0
    for i in range(1, n):
        if n % i == 0:
            sum = sum + i
    if sum == n:
        return True
    else:
        return False

for i in range(1, 1000):
    if is_perfect(i):
        print(i)


#Q.4- Write a program to print all armstrong number in an interval.

def is_armstrong(n):
    sum = 0
    temp = n
    while temp > 0:
        digit = temp % 10
        sum = sum + digit ** 3
        temp = temp // 10
    if n == sum:
        return True
    else:
        return False

for i in range(1, 1000):
    if is_armstrong(i):
        print(i)


