#include <iostream>
#include <vector>
#include <algorithm>
#include <numeric>
#include <limits>
#include <stdexcept>

#include <boost/range/irange.hpp>

int main(int argc, char const *argv[])
{
    using namespace std;
    using boost::irange;

    auto is_consecutive = [](int n) {
        int a = 0, b = 1;
        while (a < n) {
            if (a == n) return true;
            int t = a;
            a = b;
            b += t;
        }
        return false;
    };

    auto is_multiple_of_10 = [](int n) {
        return n % 10 == 0;
    };

    auto is_consecutive_multiple_of_10 = [is_consecutive, is_multiple_of_10](int n) {
        return is_consecutive(n) && is_multiple_of_10(n);
    };

    auto is_consecutive_sum = [is_consecutive](int n) {
        int a = 0, b = 1;
        while (a < n) {
            if (a + b == n) return true;
            int t = a;
            a = b;
            b += t;
        }
        return false;
    };

    auto is_consecutive_sum_multiple_of_10 = [is_consecutive_sum, is_multiple_of_10](int n) {
        return is_consecutive_sum(n) && is_multiple_of_10(n);
    };

    auto is_consecutive_sum_or_multiple_of_10 = [is_consecutive_sum_multiple_of_10, is_consecutive_multiple_of_10](int n) {
