#Q.3- Write a program to find perfect number in a given range.

def is_perfect(n):
    sum = 0
    for i in range(1, n):
        if n % i == 0:
            sum = sum + i
    if sum == n:
        return True
    else:
        return False

for i in range(1, 1000):
    if is_perfect(i):
        print(i)


#Q.4- Write a program to print all armstrong number in an interval.

def is_armstrong(n):
    sum = 0
    temp = n
    while temp > 0:
        digit = temp % 10
        sum = sum + digit ** 3
        temp = temp // 10
    if n == sum:
        return True
    else:
        return False

for i in range(1, 1000):
    if is_armstrong(i):
        print(i)


